New England Handi Rifle SB2.  This is a .243 Winchester single shot rifle with sling.  Rifle has rail for mounting optics or scope.  Break open locks up tight.  

Caliber/Gauge: .243 Win
Barrel Length:  22" 
Grip/Stock: 2pc. hardwood PG stock; 
LOP = 14 1/2"
Features: top right thumb break open release button;
 vented recoil pad; 
front/rear sling studs Sling included;

We will ship anywhere in the USA that can legally receive the firearm. We will only ship to a FFL dealer. We are a FFL dealer, and a 4473 background check is required on ALL firearm transactions. Handguns will ship for $20.00 and long guns ship for $25.00. All Sales are final. No refunds.

If you are in Wewoka, stop by, see our friendly staff, and browse our other merchandise.  We are open from 10am to 6pm Monday thru Friday, Saturday we are open 10am to 2pm.
